import { useEffect, useState } from "react"
import Point from "../Point";
// use  context provider to determine what ill be clicking?
const Grid = () =>{
    const [grid,setGrid] = useState([]);

    useEffect( () => {
        let newGrid = new Array(10);
        for (let i  = 0 ;  i < 10;i++){
            newGrid[i] = new Array(10)
            newGrid[i][0] = 1
            newGrid[i][1] = 2
            newGrid[i][2] = 3
            newGrid[i][3] = 4
            newGrid[i][4] = 5
            newGrid[i][5] = 6
            newGrid[i][6] = 7
            newGrid[i][7] = 8
            newGrid[i][8] = 9
            newGrid[i][9] = 10
        }
        setGrid(newGrid)
    },[])
    return <div className="grid">
    {grid.map((currRow,currRowIndex) => {
        // return <Point x={1}></Point>
        return <div key={currRowIndex}>
        {currRow.map( (currColumn,currColumnIndex) => <Point x={currRowIndex} y={currColumnIndex}></Point>)}
        </div>
    })}
     </div>
}

export default Grid
